CREATE DATABASE woeid_brasil;
USE woeid_brasil;

CREATE TABLE Estado (
	woe_id_estado INT NOT NULL,
    nome_estado VARCHAR(75) NOT NULL,
    uf CHAR(2) NOT NULL UNIQUE,
	PRIMARY KEY (woe_id_estado)
);

CREATE TABLE Cidade(
	woe_id_cidade INT NOT NULL,
    woe_id_estado INT NOT NULL,
    nome_cidade VARCHAR(75) NOT NULL,
    capital CHAR(1) NOT NULL DEFAULT 'N',
  PRIMARY KEY (woe_id_cidade),
  CONSTRAINT fk_cidade_estado FOREIGN KEY (woe_id_estado)
	REFERENCES Estado(woe_id_estado)
);

